/**
 * ES9+.GetBoundProfilePackage()接口,用户确认调用的接口
 * 入参：transactionId,prepareDownloadResponse
 * 出参：transactionID,boundProfilePackage
 * @author 11
 *
 */
@Service("/gsma/rsp2/es9plus/getBoundProfilePackage")
public class GetBoundProfilePackageHandler extends AbstractHandler {
	private Logger logger = LoggerFactory.getLogger(GetBoundProfilePackageHandler.class);
	
	private final static String TAG = " *** GetBoundProfilePackageHandler *** ";
	
	@Autowired
	private RspProfileService rspProfileService;
	
	@Autowired 
	private ProfileUtil profileUtil;
	
	private final String P = EccProperties.P;
	private final String A = EccProperties.A;
	private final String B = EccProperties.B;
	private final String Gx = EccProperties.Gx;
	private final String Gy = EccProperties.Gy;
	private final String N = EccProperties.N;
	private final String H = EccProperties.H;
	private static String smdpOtsk = EccProperties.SMDP_OTSK;
	private final int Keylen = Integer.parseInt(EccProperties.RSP_KEY_LEN);
	private final String share = EccProperties.RSP_SHARE;
	private String spax;
	private String spay;
	private String sM;
	private String sR;
	private String sS;
	
	@Override
	public byte[] handle(String requestStr) {
		try {
			
			EuiccMsg<MsgBody> reqMsgObject = new EuiccMsgParse().toEuiccMsg(requestStr,"/gsma/rsp2/es9plus/getBoundProfilePackage");
			GetBoundProfilePackageReq reqBody = (GetBoundProfilePackageReq) reqMsgObject.getBody();
			String transactionId = reqBody.getTransactionId();
			String euiccSigned2 = reqBody.getEuiccSigned2();
			String euiccSignature2 = reqBody.getEuiccSignature2();
			
			if(!StringUtils.isBlank(euiccSigned2)){
				logger.info("getBoundProfilePackage begin");
				logger.info("transactionId:{},euiccSigned2:{},euiccSignature2:{}",transactionId,euiccSigned2,euiccSignature2);
				
				//验transactionId
				if(!checkTransactionId(transactionId)){
					throw new RuntimeException("transaction不一致");
				}
				
				CacheBean cacheBean = MessageHelper.gs.fromJson(new JvmCacheUtil().getString(transactionId), CacheBean.class);
				
				System.out.println("cacheBean >> " + cacheBean);
				
				//验euiccSigned2{transactionId，euiccOtpk，hash},验LPAd返回的hashCc是否和DP+存储的一致
				boolean result = checkEuiccSigned2(euiccSigned2,transactionId);
				if(!result){
					throw new RuntimeException("Error >> checkEuiccSigned2");
				}
				//验euiccSignature2
				boolean result2 = checkEuiccSignature2(euiccSignature2, euiccSigned2, cacheBean);
				/*if(!result2){
					throw new RuntimeException("Error >> checkEuiccSignature2");
				}*/
				
				//用CRT、otPK.eUCC.ECKA、otSK.DP.ECKA计算会话密钥
				String euiccOtpkValue = ToTLV.determineTLV(euiccSigned2, "5F49", "04");
				String sessionKey = calSessionKey(smdpOtsk, euiccOtpkValue);
				String initialMacChaining = sessionKey.substring(0,32);
				String S_ENC = sessionKey.substring(32,64);
				String S_MAC = sessionKey.substring(64,96);
				//生成BPP,与ES8+相关
				String iccid = findIccid(cacheBean);
				String euiccOtpk = ToTLV.toTLV("5F49", euiccOtpkValue);
				String smdpOtpk = "5F494104C64BEC120BE34A4177A37F28BCA83E00B2ABBD0763F4FF0A507F12A29446F3C1A8F2EED30D229BEF097635D09CD64B643DECA1451AABACEC30916D8202CA10F7";
				
				logger.info("iccid : {}", iccid);
				logger.info("initialMacChaining : {}", initialMacChaining);
				logger.info("S_ENC : {}", S_ENC);
				logger.info("S_MAC : {}", S_MAC);
				
				String upp = getUpp(cacheBean); 
				//联通profile
				/*String upp = ""
						+ ""
						+ "";
				*/
				//电信profile
				/*String upp = ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ ""
						+ "";
				
				*/
				String BPP = genarateBPP(iccid,upp,initialMacChaining,S_ENC,S_MAC,transactionId.substring(4),euiccOtpk,smdpOtpk,true);
				
				String apduAll = respBodyByBean(transactionId,BPP);
				System.out.println("apduAll >> " + apduAll);
				
				//分包
				String[] packages = profileUtil.getUPP(apduAll, 1024 * 2);
				System.out.println(packages.length);
				
				List<String> list = new ArrayList<String>();
				for(String part : packages){
					list.add(part);
				}
				//获取第一个包
				String apdu = list.get(0);
				
				list.remove(0);
				
				CacheBean cacheBean2 = new CacheBean.CacheBeanBuilder(transactionId).setEid(cacheBean.getEid()).setPkEuiccEcdsa(cacheBean.getPkEuiccEcdsa()).setGetBppPackage(list).setMatchingId(cacheBean.getMatchingId()).build();
				new JvmCacheUtil().put(transactionId, MessageHelper.gs.toJson(cacheBean2));
				
				return httpPostResponseByRsp("application/json", apdu);
				
			}else{
				CacheBean cacheBean = MessageHelper.gs.fromJson(new JvmCacheUtil().getString(transactionId), CacheBean.class);
				List<String> list = cacheBean.getGetBppPackage();
				if(list.size()!=0){
					String apdu = list.get(0);
					list.remove(0);
					CacheBean cacheBean2 = new CacheBean.CacheBeanBuilder(transactionId).setEid(cacheBean.getEid()).setPkEuiccEcdsa(cacheBean.getPkEuiccEcdsa()).setGetBppPackage(list).setMatchingId(cacheBean.getMatchingId()).build();
					new JvmCacheUtil().put(transactionId, MessageHelper.gs.toJson(cacheBean2));
					System.out.println("cacheBean2 >> " + cacheBean);
					return httpPostResponseByRsp("application/json", apdu);
				}else{
					//设置profile状态为"Downloaded"
					setProfileState(cacheBean, ProfileStates.PROFILE_DOWNLOADED);
					logger.info("getBoundProfilePackage end");
					return httpPostResponseByRsp("application/json", "");
				}
				
			}
			
			
		} catch (Exception e) {
			e.printStackTrace();
			return httpPostResponseByRsp("application/json", respBodyByBeanError(e));
		}
		
	}

	private String getUpp(CacheBean cacheBean) {
		String matchingId = cacheBean.getMatchingId();
		RspProfileWithBLOBs rspProfileWithBLOBs = rspProfileService.selectByMatchingId(matchingId);
		return rspProfileWithBLOBs.getDerFile();
	}

	/*
	 * 查数据库找iccid
	 */
	private String findIccid(CacheBean cacheBean) {
		RspProfileWithBLOBs rspProfileWithBLOBs = rspProfileService.selectByMatchingId(cacheBean.getMatchingId());
		return rspProfileWithBLOBs.getIccid();
	}

	/*
	 * 验transactionId
	 */
	private boolean checkTransactionId(String transactionId) {
		String cache = new JvmCacheUtil().getString(transactionId);
		return StringUtils.isBlank(cache) ? false : true;
	}

	/*
	 * 调用"ES2.ConfirmOrder"计算哈希确认码expected hash value =SHA256(stored hashed Confirmation Code | TransactionID)，与收到的euiccSigned2中的hashCc作比较
	 */
	private boolean checkEuiccSigned2(String euiccSigned2 , String transactionId) {
		String hashCc = euiccSigned2.substring(euiccSigned2.indexOf("0420")+"0420".length());   //待确认
		String euiccOtpk = ToTLV.determineTLV(euiccSigned2, "5F49", "04");
		String Qx = euiccOtpk.substring(2, 66);
		System.out.println("Qx **************: "+Qx);
		String Qy = euiccOtpk.substring(66);
		System.out.println("Qy **************: "+Qy);
		CacheBean cacheBean = MessageHelper.gs.fromJson(new JvmCacheUtil().getString(transactionId),CacheBean.class);
		String matchingId = cacheBean.getMatchingId();
		String dbHashCc = findCc(matchingId);     //确认码计划从数据库中取
		String expectHashCc = SHA256(new StringBuilder().append(dbHashCc).append(transactionId.substring(4)).toString());
		return StringUtils.equals(hashCc, expectHashCc);
	}

	/*
	 * 计算哈希值
	 */
	private String SHA256(String string) {
		return SHA256Util.Encrypt(string,"SHA-256");
	}

	/*
	 * 通过matchingId查找确认码
	 */
	private String findCc(String matchingId) {
		RspProfileWithBLOBs rspProfileWithBLOBs = rspProfileService.selectByMatchingId(matchingId);
		return rspProfileWithBLOBs.getHashCc();
	}

	/*
	 * 改数据库，设置profile状态为"Downloaded"
	 */
	private void setProfileState(CacheBean cacheBean, String profileState) {
		String matchingId = cacheBean.getMatchingId();
		RspProfileWithBLOBs rspProfileWithBLOBs = rspProfileService.selectByMatchingId(matchingId);
		String stateOfProfile = rspProfileWithBLOBs.getProfileState();
		if(StringUtils.equals(stateOfProfile, ProfileStates.PROFILE_RELEASED)){
			rspProfileWithBLOBs.setProfileState(profileState);
			rspProfileService.updateByPrimaryKeySelective(rspProfileWithBLOBs);
		}else{
			throw new RuntimeException("当前profile状态不符合条件");
		}
		
	}

	/*
	 * 拼Bound Profile Package
	 */
	private String genarateBPP(String iccid, String UPP, String initialMacChaining, String s_ENC, String s_MAC, String transactionId, String euiccOtpk, String smdpOtpk, boolean bool) {
		//调bc接口,待完善
		return profileUtil.generateBPP(iccid, UPP, initialMacChaining, s_ENC, s_MAC, transactionId, euiccOtpk, smdpOtpk, bool);
	}

	/*
	 * 用CRT、otPK.eUCC.ECKA、otSK.DP.ECKA计算会话密钥
	 */
	private String calSessionKey(String otSK_DP_ECKA, String euiccOtpkValue) {
		String Qx = euiccOtpkValue.substring(2, 66);
		String Qy = euiccOtpkValue.substring(66);
		String sessionKey = ECCUtils.eccKeyAgreement(P, A, B, Gx, Gy, N, H, otSK_DP_ECKA, Qx, Qy, share, Keylen);
		if(StringUtils.isBlank(sessionKey)){
			throw new RuntimeException("ECC生成shs算法出错");
		}
		return sessionKey;
		
	}

	/*
	 * 用PK.EUICC.ECDSA验证euiccSignature2  ECC验签  待签名数据sM为：euiccSigned2 + smdpSignature2
	 */
	private boolean checkEuiccSignature2(String euiccSignature2, String euiccSigned2, CacheBean cacheBean) {
		String pkEuiccEcdsa = cacheBean.getPkEuiccEcdsa();
		String smdpSignature2 = cacheBean.getSmdpSignature2();
		spax = pkEuiccEcdsa.substring(0, 64);
		System.out.println("spax ****************　"+spax);
		spay = pkEuiccEcdsa.substring(64);
		System.out.println("spay ****************　"+spay);
		sM = new StringBuilder().append(euiccSigned2).append(smdpSignature2).toString();
		System.out.println("sM ****************　"+sM);
		String euiccSignature2Value = euiccSignature2.substring(6);
		sR = euiccSignature2Value.substring(0, 64);
		System.out.println("sR ****************　"+sR);
		sS = euiccSignature2Value.substring(64);
		System.out.println("sS ****************　"+sS);
		return ECCUtils.eccECKAVerify(P, A, B, Gx, Gy, N, H, sM, spax, spay,  sR, sS);
	}

	private String respBodyByBean(String transactionId, String bPP){
		StatusCodeData statusCodeData = new StatusCodeData("00");
		FunctionExecutionStatus functionExecutionStatus = new FunctionExecutionStatus("Executed-Success", statusCodeData);
		HeaderResp head = new HeaderResp(functionExecutionStatus);
		GetBoundProfilePackageResp resp = new GetBoundProfilePackageResp();
		resp.setHeader(head);
		resp.setTransactionID(transactionId);
		resp.setBoundProfilePackage(bPP);
		return MessageHelper.gs.toJson(resp);
	}
	
	private String respBodyByBeanError(Exception e){
		StatusCodeData statusCodeData = new StatusCodeData("01", TAG + e.getMessage());
		FunctionExecutionStatus functionExecutionStatus = new FunctionExecutionStatus("Executed-Failure", statusCodeData);
		HeaderResp head = new HeaderResp(functionExecutionStatus);
		GetBoundProfilePackageResp resp = new GetBoundProfilePackageResp();
		resp.setHeader(head);
		return MessageHelper.gs.toJson(resp);
	}
	
}
